import React, { useState } from "react";
import "../aba/aba.css";

function Aba() {
  const [conteudoAtivo, setConteudoAtivo] = useState("campos");

  return (
    <div className="aba">
      {/* Botões de navegação das abas */}
      <div className="abas">
        <button
          className={conteudoAtivo === "campos" ? "ativo" : ""}
          onClick={() => setConteudoAtivo("campos")}
        >
          Campos
        </button>
        <button
          className={conteudoAtivo === "typeCode" ? "ativo" : ""}
          onClick={() => setConteudoAtivo("typeCode")}
        >
          Type Code
        </button>
        <button
          className={conteudoAtivo === "download" ? "ativo" : ""}
          onClick={() => setConteudoAtivo("download")}
        >
          Download
        </button>
        <button
          className={conteudoAtivo === "copy" ? "ativo" : ""}
          onClick={() => setConteudoAtivo("copy")}
        >
          Copy
        </button>
        <button
          className={conteudoAtivo === "code" ? "ativo" : ""}
          onClick={() => setConteudoAtivo("code")}
        >
          Code
        </button>
      </div>

      {/* Área de conteúdo */}
      <div className="conteudos">
        {conteudoAtivo === "campos" && (
          <div className="campos">Conteúdo de Campos</div>
        )}
        {conteudoAtivo === "typeCode" && (
          <div className="typeCode">Conteúdo de Type Code</div>
        )}
        {conteudoAtivo === "download" && (
          <div className="download">Conteúdo de Download</div>
        )}
        {conteudoAtivo === "copy" && (
          <div className="copy">Conteúdo de Copy</div>
        )}
        {conteudoAtivo === "code" && (
          <div className="code">Conteúdo de Code</div>
        )}
      </div>
    </div>
  );
}

export default Aba;
